func TestPsUnpacker(t *testing.T) {
	unpacker := NewPsUnpacker()

	for i, item := range goldenRtpList {
		nazalog.Debugf("%d", i)
		b, _ := hex.DecodeString(item)
		nazalog.Debugf("%s", hex.Dump(nazabytes.Prefix(b, 128)))
		unpacker.FeedRtpPacket(b)
	}
}

